import './patientEnter.css';
import React, { useState } from 'react';

const PatientEnter = ({ handleEnterReception }) => {
  const [patientId, setPatientId] = useState('');
  const [patientName, setPatientName] = useState('');
  const [isConfirmationPressed, setIsConfirmationPressed] = useState(false);
  const [isConfirmationPressed2, setIsConfirmationPressed2] = useState(false);
  const [currentDate, setCurrentDate] = useState('');
  const [currentTime, setCurrentTime] = useState('');
  const [uniqueNumber, setUniqueNumber] = useState('');

  const handleKeyPressNumbers = (key) => {
    if (key === 'x') {
      // Delete the last character
      setPatientId((prevId) => prevId.slice(0, -1));
    } else if (key === 'המשך') {
      setIsConfirmationPressed(true);
    } else {
      // Append the digit or character
      setPatientId((prevId) => prevId + key);
    }
  };

  const handleKeyPressName = (key) => {
    if (key === 'x') {
      // Delete the last character
      setPatientName((prevName) => prevName.slice(0, -1));
    } else {
      // Append the character
      setPatientName((prevName) => prevName + key);
    }
  };

  const handleSubmit = () => {
    if (!isConfirmationPressed) {
      if (patientId.trim() === '') {
        alert('Please enter ID');
        return;
      }
    } else {
      if (patientName.trim() === '') {
        alert('Please enter Name');
        return;
      }

      setIsConfirmationPressed(false);
      setIsConfirmationPressed2(true);

      // You may generate a unique number, date, and time here
      const uniqueNumber1 = handleEnterReception();
      const currentDate1 = new Date().toLocaleDateString();
      const currentTime1 = new Date().toLocaleTimeString();

      setCurrentDate(currentDate1);
      setCurrentTime(currentTime1);
      setUniqueNumber(uniqueNumber1);

      // Reset the state after 10 seconds
      setTimeout(() => {
        setPatientId('');
        setPatientName('');
        setIsConfirmationPressed2(false);
      }, 5000);
    }
  };

  const hebrewCharacters = ['א', 'ב', 'ג', 'ד', 'ה', 'ו', 'ז', 'ח', 'ט', 'י', 'כ', 'ך', 'ל', 'מ', 'ם', 'נ', 'ן', 'ס', 'ע', 'פ', 'ף', 'צ', 'ץ', 'ק', 'ר', 'ש', 'ת'];

  return (
    <div className='patientNumber'>
      <div className='patientNumberCont'>
        {!isConfirmationPressed && !isConfirmationPressed2 && (
          <>
            <div className='patientID enter'>
              <input
                placeholder="הכנס מספר תעודת זהות"
                type="text"
                value={patientId}
                readOnly
                className='inputBtn'
              />
            </div>
            <div className='virtual-keyboard numbers'>
              {[...Array(10).keys()].map((key) => (
                <button
                  key={key}
                  className='keyboard'
                  onClick={() => handleKeyPressNumbers(key.toString())}
                >
                  {key}
                </button>
              ))}
              <button
                className=' keyboard deleteNumber'
                onClick={() => handleKeyPressNumbers('x')}
                key={'x'}
              >
                x
              </button>
              <button
                className='keyboard subNumber'
                onClick={() => handleKeyPressNumbers('המשך')}
                key={'המשך'}
              >
                המשך
              </button>
            </div>
          </>
        )}
        {isConfirmationPressed && (
          <>
            <div className='patientName enter'>
              <input
                placeholder="הכנס שם מלא  "
                type="text"
                value={patientName}
                onChange={(e) => setPatientName(e.target.value)}
                className='inputBtn'
              />
            </div>
            <div className='virtual-keyboard hebrew'>
              {[...hebrewCharacters].map((key) => (
                <button
                  key={key}
                  className='keyboard'
                  onClick={() => handleKeyPressName(key.toString())}
                >
                  {key}
                </button>
              ))}
              <button
                className='keyboard'
                onClick={() => handleKeyPressName(' ')}
                key={' '}
              >
                __
              </button>
              <button
                className=' keyboard deleteNumber'
                onClick={() => handleKeyPressName('x')}
                key={'x'}
              >
                x
              </button>
            </div>
            <button className='getNumber' onClick={handleSubmit}>
              קבלת תור
            </button>
          </>
        )}
        {isConfirmationPressed2 && (
          <>
            <div className='patientInfo'>
                <div className='numberCont'>מספרך בתור:
              <div className='uniqueNumber'>
                {uniqueNumber}
              </div>
               </div>
              <div>מספר תעודת זהות: {patientId}</div>
              <div>שם: {patientName}</div>

              <div>תאריך: {currentDate}</div>
              <div>שעה: {currentTime}</div>
            </div>
            <div className='saveNumber'>
              יש לשמור את המספר לאורך הטיפול
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default PatientEnter;
